// SongResults.js
import React from 'react';

function SongResults({ results, playSong }) {
  if (results.length === 0) {
    // If there are no results, return null (component won't render)
    return null;
  }

  return (
    <div>
      <h2>Song Results</h2>
      <ul>
        {results.map((result) => (
          <li key={result._id}>
            <strong>Title:</strong> {result.name}, <strong>Artist:</strong> {result.artist}, <strong>Album:</strong>{' '}
            {result.album}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default SongResults;
